string deviceControler::magCardRfidScan(bool kbd)
{
	BYTE key = NOKEY;
	string wyciep;
	stringstream tempsremp;
	char track1[100];
	char track2[100];
	char track3[100];
	char trck[11];
	string str2;
	string hexNum;

	str2.clear();
	string send = "end";
	stringstream compo;
	stringstream compo1;
	compo1.str("");
	string temp;
	int ret;
	bool presed = false;
	bool readed = false;
	memset(track1, 0, sizeof(track1));
	memset(track1, 0, sizeof(track2));
	memset(track1, 0, sizeof(track3));
	string title = "Przeciagnij karte";
	compo1 << title;
	int len = title.size();
	for(int i = 0; i < 21 - len;  i++)
	{
		compo1 << " ";
	}
	title.clear();
	title = compo1.str();
	if(Mcr_Open()<0)
	{
		// zapis do pliku nie moge zainicjalizowac urzadzenia !!
	}
	Kb_Flush();
	while(1)
	{
		while(1)
		{

			Lcd_Cls();
			Lcd_Printxy(0,0,1, const_cast<char *>(title.c_str()) );
			if (str2.size() > 0)
			{
				Lcd_Printxy(0,32,0, const_cast<char *>(str2.c_str()) );
			}


			if(!Kb_Hit())
			{
				cout << "ncisnalem guzik" << endl;
				key = Kb_GetKey();
				if(key != NOKEY)
				{
					presed = true;
					if (key == KEYCANCEL)
					{
						cout << "CANCEL wcisniety !!" << endl;
						Kb_Flush();
					return send;
				}
					break;
				}
				else
				{
					presed = false;
				}
			}
		
			DelayMs(50);	
			ret = Mcr_Read((BYTE *)track1, (BYTE *)track2, (BYTE *)track3);
			if (ret&0x80)
			{

				if(ret & 1){
					cout << "zwartosc ret: " << ret << endl;
					cout << "track 1" << endl;
					for(int i = 0; i < 10; i++)
					{
						trck[i]=track1[i];
					}
					trck[10] = 0;

					cout << "dane z track1 w trck: " << trck << endl;

					readed = true;
					break;
				}
				if(ret & 2){
					cout << "zwartosc ret: " << ret << endl;
					cout << "track 2: " << endl;
					for(int i = 0; i < 10; i++)
					{
						trck[i]=track2[i];	
					}
					trck[10] = 0;

					cout << "dane z track2 w trck: " << trck << endl;

					readed = true;
					break;
				}
				if(ret & 3){
					cout << "zwartosc ret: " << ret << endl;
					cout << "track 3" << endl;
					for(int i = 0; i < 10; i++)
					{
						trck[i]=track3[i];
					}
					trck[10] = 0;

					cout << "dane z track3 w trck: " << trck << endl;

					readed = true;
					break;
				}
			}
		}

		ret = rfidSilentScan();
		rfidRead();
		if(ret == 1)
		{
			hexNum = rfidRetrunStringId();
			return hexNum;
		}


		if(kbd)
		{
			cout << "klawcia jest na chodzie wyswietlam to co wpisalem" << endl;

			if(presed){
				switch(key)
				{
							case KEY0:
								compo << "0";
								str2.clear();
								str2 = compo.str();
								Kb_Flush();
							break;
							case KEY1:
								compo << "1";
								str2.clear();
								str2 = compo.str();
								Kb_Flush();
							break;
							case KEY2:
								compo << "2";
								str2.clear();
								str2 = compo.str();
								Kb_Flush();
							break;
							case KEY3:
								compo << "3";
								str2.clear();
								str2 = compo.str();
								Kb_Flush();
							break;
							case KEY4:
								compo << "4";
								str2.clear();
								str2 = compo.str();
								Kb_Flush();
							break;
							case KEY5:
								compo << "5";
								str2.clear();
								str2 = compo.str();
								Kb_Flush();
							break;
							case KEY6:
								compo << "6";
								str2.clear();
								str2 = compo.str();
								Kb_Flush();
							break;
							case KEY7:
								compo << "7";
								str2.clear();
								str2 = compo.str();
								Kb_Flush();
							break;
							case KEY8:
								compo << "8";
								str2.clear();
								str2 = compo.str();
								Kb_Flush();
							break;
								case KEY9:
								compo << "9";
								str2.clear();
								str2 = compo.str();
								Kb_Flush();
							break;
							case KEYENTER:
								cout << "nacisnalem enterem" << endl;
								if(str2.size() >= 6 && str2.size() < 30)
								{
									cout << "wyciepuje wartosc z klawci" << endl;
									return str2;
								}
								else
								{
									Lcd_Cls();
									Lcd_Printxy(0,0,0,"Informacja");
									Lcd_Printxy(0,32,0, "Podales zakrotki badz zadlugi numer.");
									DelayMs(5000);
								}
								Kb_Flush();
							break;
							case KEYCANCEL:
								Kb_Flush();
								return send;
							break;
							case KEYBACKSPACE:
								temp.clear();
								temp = compo.str();
								int len = temp.size();
								if(len == 0)
								{
									str2.clear();
									break;
								}
								else
								{
									temp = temp.erase(len-1);
									compo.str("");
									compo.clear();
									compo << temp;
									str2.clear();
									str2 = temp;
								}
								Kb_Flush();
							break;
							default:
								Kb_Flush();
							break;
				}
			}
		}

		if (readed)
		{
			break;
		}



	}	
	cout << "jestem za while przed mcrclose" << endl;
	Mcr_Close();
	tempsremp << trck;
	wyciep = tempsremp.str();
	return wyciep;
}

void deviceControler::hexToString(char *str, BYTE* buf, int len)
{
	        int j = 0;
	        for(int i = 0; i < len; i++){
	                str[j] = (buf[i]/16);
	                if(str[j] > 9)
	                        str[j] += 'A' - 10;
	                else
	                        str[j] += '0';
	                str[++j] = (buf[i]%16);
	                if(str[j] > 9)
	                        str[j] += 'A' - 10;
	                else
	                        str[j] += '0';
	                j++;
	        }
	        putchar('\n');
	        str[j] = 0;
}

