bool deviceControler::isPrinterReady()
{
	int state = Prn_CheckStatus();
	int key = KEYENTER;

	if(!state)
		return true;

	while((state = Prn_CheckStatus()) && key != KEYENTER){
		switch(state){	
			case PRINTER_HIGHTEMP_MASK :
				//printError("Glowica drukarki\n   przegrzana   \nOdczekaj chwile \n i kliknij OK   ");
				break;
			case PRINTER_NOPAPER_MASK : 
				//printError("  Brak papieru  \n   w drukarce   \nUzupelnij papier\n i kliknij OK   ");
				break;
			case 0 :
				return true;
			case PRINTER_RIBBON_FAILED_MASK :
			default:
				char buf[65];
				sprintf(buf," Blad drukarki \nkod bledu=0x%x",state);
				//printError(buf);
				break;
		}
		//key = CKeyboardInterface::WaitKey(200);
	}
	return false;
}

void deviceControler::center(string &cent)
{
	int lineWidth = 22;
	stringstream compose;
	for (int i = 0; i < ((lineWidth - cent.size()) /2); ++i)
	{
		compose << " ";
	}
    compose << cent << endl;
    cent.clear();
    cent = compose.str();
}

void deviceControler::justify(char* to, const char* left, const char* right)
{
    int space = (int)' ';
    memset(to, space, lineWidth);
    strncpy(to, left, strlen(left));
    strcpy(&to[lineWidth - strlen(right)], right);
    to[lineWidth] = 0;
}

char* deviceControler::formatAmount(unsigned long a, char *temp)
{
    unsigned int i,j;
    char amount[32];
    
    sprintf(amount,"%ld",a );
    
    temp[0] = 0;

    if(strlen(amount)<4){
        strcpy(temp, amount);
        return temp;
    }
    // pierwszy separator
    i = strlen(amount) % 3;
  
    if(i!=0){
        strncat(temp, amount, i);
        strcat(temp, " ");
    }
    
    for(j=0; j< strlen(amount) / 3;  j++){
        strncat(temp, &amount[j*3]+i, 3);
        if(j < strlen(amount)/3 -1)
            strcat(temp, " ");
    }
    return temp;
}

