void deviceControler::printTx(string seriallNr, string sellerId, string date, string cid, string sum, string point, string extra, string footer, string trxNumber)
{

	stringstream compose;
	string row;
	string temp = trxNumber;
	//printBold(1);

	printerInit(16);
	printerHeader(seriallNr, sellerId, date, cid);

	compose.str("");
	compose << "TID: " << temp[0] << temp[1] << temp[2] << temp[3] << endl;
	row.clear();
	row = compose.str();
	Prn_printf((char *)row.c_str());	

	temp.erase(1,4);

	compose.str("");
	compose << "MID: " << temp << endl;
	row.clear();
	row = compose.str();
	Prn_printf((char *)row.c_str());	

	row.clear();
	row = "-----------------------";
	Prn_printf((char *)row.c_str());

	printLines(1);

	compose.str("");
	for (int i = 0; i < sum.size(); ++i)
	{
		if (i == (sum.size() - 2))
		{
			compose << "," << sum[i];
		}
		else
		{
			compose << sum[i];
		}
	}

	sum.clear();
	sum = compose.str();

	compose.str("");
	compose << "Kwota: " << sum << " zl" << endl;
	row.clear();
	row = compose.str();
	Prn_printf((char *)row.c_str());

	printLines(1);

	compose.str("");
	compose << "Liczba punktow: " << point << endl;
	row.clear();
	row = compose.str();
	Prn_printf((char *)row.c_str());

	printLines(1);

	compose.str("");
	compose << "W tym extra: " << extra << endl;
	row.clear(); 
	row = compose.str();
	Prn_printf((char *)row.c_str());

	printLines(2);

	center(footer);

	row.clear();
	row = "----------------------\n";
	Prn_printf((char *)row.c_str());

	compose.str("");
	compose << footer << endl;
	row.clear();
	row = compose.str();
	Prn_printf((char *)row.c_str());
	//printBold(0);
	printLines(3);

	Prn_Start();	
}

